Descripción:
Es un conductor metálico eléctrico utilizado para proteger y encauzar los cables eléctricos en instalaciones eléctricas. Este tubo está hecho de acero galvanizado.

Ampliamente utilizado en instalaciones eléctricas residenciales, comerciales e industriales. Proporciona una protección confiable y segura para los cables eléctricos, manteniéndolos organizados y protegidos de daños externos.

